import React from "react";
import { Col} from "reactstrap";
import { Origin } from 'redux-tooltip'; 
import { Tooltip } from 'redux-tooltip';
const SingleMovie = ({poster_path, title, id}) => {


    return (
        <Col  xs="2" >
           <Origin key={id}>
               <div className='movie_card' id="DisabledAutoHideExample">
            <h5 className='search_result_card_title'>{title}</h5>
            <img className='search_image img-fluid' src={`https://image.tmdb.org/t/p/w500${poster_path}`}  alt="" />
            </div> </Origin>
            <Tooltip>
                     Hello Tooltip!
            </Tooltip>

        </Col>
    )
}
export default  SingleMovie
